import base64


class DocumentsDownLoadService:
    def __init__(self):
        self.docs = {}
        self.delimiter = '_'

    def create_file_name(self, file_name):
        file_name_parts = file_name.split('.')
        if len(file_name_parts) == 1:
            return '{0}{1}{2}'.format(
                file_name,
                self.delimiter,
                self.docs[file_name]
            )
        file_name_without_extension = ('.').join(file_name_parts[:-1])
        return '{0}{1}{2}.{3}'.format(
            file_name_without_extension,
            self.delimiter,
            self.docs[file_name],
            file_name_parts[-1]
        )

    def create_file(self, file_name):
        if file_name in self.docs:
            self.docs[file_name] = self.docs[file_name] + 1
        else:
            self.docs[file_name] = 0

        try:
            text_file = open(file_name, 'xb')
        except FileExistsError:
            name = self.create_file_name(file_name)
            text_file = open(name, 'xb')

        return text_file

    def execute_file(self, n):
        i = 1
        while i <= n:
            blob = ""
            file = 'rahul/rahul.pdf'
            text_file = self.create_file(file)
            blob = base64.b64decode(blob)
            text_file.write(blob)
            text_file.close()
            i = i+1


if __name__ == "__main__":
    doc_download_svc = DocumentsDownLoadService()
    doc_download_svc.execute_file(50)
